import React, {Component} from 'react';
import { MemoryRouter, Switch, Route } from 'react-router-dom';
import Home from "../Home/Home";

class RouteBlock extends Component {
    render() {
        return (
            <>
                <Switch>
                    <Route path="/">
                        <Home />
                    </Route>
                </Switch>
            </>
        )
    }
}

export default RouteBlock;
